- input: "TEXT\x1CC00362020\x1C1\x1C\x1CF3XA\x1CThis report is being filed after an
    internal review found that nine contributions were mistakenly reported twice during
    2006 as a result of an administrative error.  This report reflects the adjusted
    cash on hand totals.  Please note that based on your guidance, we did not amend
    the reports filed during the 2008 election cycle.  As a result, the 2008 year-end
    report showed year-end cash on hand totals equaling $32,067.97.  The adjusted
    cash on hand totals for the 2008 year-end report, after the $8,500 from the double
    reported receipts was subtracted, equaled $23,567.97.  This report shows the adjusted
    cash on hand total of $23,567.97.\n"
